import React from "react";
import "./Piece.css";

class Piece extends React.Component {

	constructor(props) {
		super(props);
		Piece.instances.push(this);
		this.number = props.number;
		this.tile = props.tile;
		this.state = {
			tile: this.tile
		}
	}

	handleClick(e) {
		console.log("this is this element:" + this);	
	}

	render() {
		let theId = "_" + this.number;
		return (
			<div>
				<div className="piece" onClick={(event) => this.handleClick} data-number={this.number} id={theId}>
				{this.number}
				</div>
			</div> );

	}
}

Piece.instances = [];



export default Piece;
